import React from 'react';
import { Link } from 'react-router-dom'
import { makeStyles } from '@material-ui/core/styles';
import { AppBar, Toolbar, Typography, IconButton } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import MoreVertIcon from '@material-ui/icons/MoreVert';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '100%',
        flexGrow: 1,
    },
    title: {
        flexGrow: 1
    },
    linkTo: {
        textDecoration: 'none',
        color: '#000'
    },
    linkHome: {
        textDecoration: 'none',
        color: '#fff'
    }
}));
export default function MenuTop() {
    const classes = useStyles();
    const [anchorEl, setAnchorEl] = React.useState(null);
    const isMenuOpen = Boolean(anchorEl);
    const handleProfileMenuOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleMenuClose = () => {
        setAnchorEl(null);
    };
    const menuId = 'primary-search-account-menu';
    const renderMenu = (
        <Menu
            anchorEl={anchorEl}
            anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
            id={menuId}
            keepMounted
            transformOrigin={{ vertical: 'top', horizontal: 'right' }}
            open={isMenuOpen} y

            onClose={handleMenuClose}
        >
            <MenuItem onClick={handleMenuClose}><Link to="/mans" className={classes.linkTo}>Man</Link></MenuItem>
        </Menu>
    );
    return (
        <div className={classes.root}>
            <AppBar position="static" color="primary">
                <Toolbar>
                    <IconButton edge="start" color="inherit" aria-label="menu">
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" className={classes.title}>
                        <Link to="/" className={classes.linkHome}>Demo React ASP Core</Link>
                    </Typography>
                    <IconButton edge="end" color="inherit" aria-label="MoreVert" aria-controls={menuId}
                        aria-haspopup="true"
                        onClick={handleProfileMenuOpen}>
                        <MoreVertIcon />
                    </IconButton>
                </Toolbar>
            </AppBar>
            {renderMenu}
        </div>
    )
}
